import React from 'react';
import './App.css';

const App = () => {
  return (
    <div className="app-wrapper">
      <header className="header">
        <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcR4pKTK4hGvAxEjxqDWily0XOFIewS2egEfuShOwOmrYn1L8Tzs&usqp=CAU"/>
      </header>
        <nav className="nav">
            <div>
                <a href="">Messages</a>
            </div>
            <div>
                <a href="">News</a>
            </div>
            <div>
                <a href="">Setting</a>
            </div>
        </nav>
        <div className="content">
            Main content
        </div>
    </div>
  );
};

export default App;
